import React, { useState } from 'react';
import './styles/Login.css';
import { Box, Button, TextField } from '@material-ui/core';
import EmailIcon from '@material-ui/icons/Email';
import LockIcon from '@material-ui/icons/Lock';
import Grid from '@material-ui/core/Grid';
import Checkbox from '@material-ui/core/Checkbox';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import CheckBoxOutlineBlankIcon from '@material-ui/icons/CheckBoxOutlineBlank';
import CheckBoxIcon from '@material-ui/icons/CheckBox';
import Link from '@material-ui/core/Link';
import Logo from './images/logo.png';
import clsx from 'clsx';
import IconButton from '@material-ui/core/IconButton';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';
import Visibility from '@material-ui/icons/Visibility';
import VisibilityOff from '@material-ui/icons/VisibilityOff';

const Login = () => {
  const [values, setValues] = useState({
    formData: {
      email: '',
      password: '',
    },
    showPassword: false,
    passwordError: ''
  });

  const handleChange = (prop) => (event) => {
    setValues({ ...values, formData: { ...values.formData, [prop]: event.target.value } });
  };

  const handleClickShowPassword = () => {
    setValues({ ...values, showPassword: !values.showPassword });
  };

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!values.passwordError) {
      // Password meets the criteria, perform login
      console.log('Login successful');
      // Add form submission logic here
    } else {
      // Password does not meet the criteria, do not perform login
      console.log('Password does not meet the criteria');
    }
  };

  const validatePassword = (password) => {
    const passwordRegex = /^(?=.*[a-z])(?=.*[A-Z])(?=.*\d)(?=.*[!@#$%^&*()_+])[A-Za-z\d!@#$%^&*()_+]{6,}$/;
    if (!passwordRegex.test(password)) {
      setValues({ ...values, passwordError: 'Password must have at least one uppercase letter, one lowercase letter, one number, one special character, and a minimum length of 6 characters' });
    } else {
      setValues({ ...values, passwordError: '' });
    }
  };

  return (
    <>
      <Box container boxShadow={3} margin="10% auto" alignItems="center" width={500} height={360} >
        <img src={Logo} alt="logo" className="logo" /><br />
        <form onSubmit={handleSubmit} autoComplete="off">
          <Grid container spacing={1} alignItems="flex-end">
            <Grid item>
              <EmailIcon className="mrl" />
            </Grid>
            <Grid item>
              <TextField
                name="email"
                value={values.formData.email}
                onChange={handleChange('email')}
                id="input-with-icon-grid"
                label="Email"
                color="secondary"
                className="email"
              />
            </Grid>
          </Grid>

          <Grid container spacing={1} alignItems="flex-end">
            <Grid item>
              <LockIcon className="mrl" />
            </Grid>
            <Grid item>
              <FormControl className={clsx()}>
                <InputLabel htmlFor="standard-adornment-password" style={{ marginLeft: '15%' }}>Password*</InputLabel>
                <Input
                  name="password"
                  value={values.formData.password}
                  onChange={(e) => {
                    handleChange('password')(e);
                    validatePassword(e.target.value);
                  }}
                  label="Password"
                  color="secondary"
                  className="password"
                  id="standard-adornment-password"
                  type={values.showPassword ? 'text' : 'password'}
                  endAdornment={
                    <InputAdornment position="end">
                      <IconButton
                        aria-label="toggle password visibility"
                        onClick={handleClickShowPassword}
                        onMouseDown={handleMouseDownPassword}
                      >
                        {values.showPassword ? <Visibility /> : <VisibilityOff />}
                      </IconButton>
                    </InputAdornment>
                  }
                />
                {values.passwordError && <FormHelperText error>{values.passwordError}</FormHelperText>}
              </FormControl>
            </Grid>
          </Grid>

          <Grid container spacing={3}>
            <Grid item xs={6} className="gd">
              <FormControlLabel control={<Checkbox icon={<CheckBoxOutlineBlankIcon fontSize="small" />} checkedIcon={<CheckBoxIcon fontSize="small" />} name="checkedI" />} label="Secure Login" />
            </Grid>
            <Grid item xs={6} >
              <Link href="#" color="secondary" className="gd1">
                {'Forget Password'}
              </Link>
            </Grid>
          </Grid>
          <Button disabled={values.passwordError} variant="contained" color="secondary" className="btn" size="large" type="submit">Login</Button>
        </form>
        <p style={{ color: '#6b6a6a', textAlign: 'center' }}>All Right Reserved</p>
      </Box>
      <br />
    </>
  );
}

export default Login;
